import React from "react";
import Slider from "react-slick";
import Card from "./Card";
import Pimage from "./images/_af49ea8e-1cfe-491f-b568-6888c48f7f93.jpeg";
import Rstar from "./images/star.png";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

const ProductSlider = () => {
  const cardData = [
    {
      image: Pimage,
      star: Rstar,
      name: "Product 0",
      description: "Description 1",
      price: "$19.99",
    },
    {
      image: Pimage,
      star: Rstar,
      name: "Product 2",
      description: "Description 2",
      price: "$29.99",
    },
    {
      image: Pimage,
      star: Rstar,
      name: "Product 2",
      description: "Description 2",
      price: "$29.99",
    },
    {
      image: Pimage,
      star: Rstar,
      name: "Product 3",
      description: "Description 2",
      price: "$29.99",
    },
    {
      image: Pimage,
      star: Rstar,
      name: "Product 4",
      description: "Description 2",
      price: "$29.99",
    },
    {
      image: Pimage,
      star: Rstar,
      name: "Product 5",
      description: "Description 2",
      price: "$29.99",
    },
    {
      image: Pimage,
      star: Rstar,
      name: "Product 6",
      description: "Description 2",
      price: "$29.99",
    },
    {
      image: Pimage,
      star: Rstar,
      name: "Product 7",
      description: "Description 2",
      price: "$29.99",
    },
    {
      image: Pimage,
      star: Rstar,
      name: "Product 8",
      description: "Description 2",
      price: "$29.99",
    },
    // Add more card data as needed
  ];

  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 5,
    slidesToScroll: 1,
  };

  return (
    <Slider {...settings}>
      {cardData.map((card) => (
        <div key={card.name}>
          <Card
            image={card.image}
            star={card.star}
            name={card.name}
            description={card.description}
            price={card.price}
          />
        </div>
      ))}
    </Slider>
  );
};

export default ProductSlider;
